export const BioText = "Hi, my name is Denis. Since I was a kid, I developed a strong aptitude " +  
                            "for critical thinking and solving math problems. Later, when I got my first computer," +
                             " I wanted to learn everything about it inside and out. I assembled my first computer when" +
                             " I was 14 years old. I started to learn programming back then, but it was only" +
                             " a hobby for me at that time. Only later I decided to do computer programming professionally." +
                             " Since then, I've been passionate about programming, and I've never considered occupying myself with anything else.";

export const FamilyText = "My other passion is my family which is my beautifull wife and adorable o";

export const WSCCText = "WSCC";

